export const getRestaurantData = () => {
    const requestOptions = {
        method: 'GET',
        headers : {'content-type' : 'application/json', 'Accept' : 'application/json'}
    }
    const url = "https://66988ec62069c438cd6f1af8.mockapi.io/api/restaurantlist/RestaurantData";

    fetch(`${url}`, requestOptions)
        .then( async (response) => {
            console.log('bhargavhere', response)
            const isJson = response.headers.get('content-type')?.includes('applications/json')
            const data = isJson && await response.json()
            if(!response.ok){
                return Promise.reject(data?.error)
            }
            return data;
        })
        .then((response) => {
            console.log('bhargavhere2', response)

            if(response){
                return Promise.resolve(response);
            }
        })
        .catch((error) => {
            if(error){
                return Promise.reject(error)
            }
        });
}
